import './FirmFactCard.scss';

interface FirmFactCardProps {
  variant: 'default' | 'border';
  buttonText: string;
  icon: boolean;
  disabledButton?: boolean;
  text?: string;
  isTwoLine: boolean;
}

const FirmFactCard: React.FC<FirmFactCardProps> = ({ 
  variant, 
  buttonText, 
  icon, 
  disabledButton, 
  text, 
  isTwoLine 
}) => {
  return (
    <div className={`firmFactCard ${variant} ${disabledButton ? 'disabled' : ''} ${isTwoLine ? 'two-line' : ''}`}>
      <div className="card-content">
        {icon && <span className="icon">üîç</span>}
        <button disabled={disabledButton}>{buttonText}</button>
        {text && <p>{text}</p>}
      </div>
    </div>
  );
};

export default FirmFactCard;
